function LocomotiveBtn({isFocused, handleLocomotiveClick}) {
  return (
    <>
    {isFocused ? (
        <button className="btn_locomotive_focused" key={wagon_number} onClick={() => handleLocomotiveClick()}>
        </button>
    ) : (
        <button className="btn_locomotive" key={wagon_number} onClick={() => handleLocomotiveClick()}>
        </button>
    )}
    </>
  );
}
  
export default LocomotiveBtn;
